const About = () => (
  <Layout>
    <div>
      <h1>About BitzPrice</h1>
      <p>
        BitzPrice is an app that allows you to{" "}
        <strong>check the current Bitcoin (BTC)</strong> rate in multiple
        currencies, including USD, GBP & EUR.
      </p>
    </div>
  </Layout>
);

export default About;
